import React from "react";
import moment from "moment";
import axios from "axios";
import { useState, useEffect } from "react";
import "../styles/timeline.css";

import Timeline, {
  TimelineHeaders,
  SidebarHeader,
  DateHeader,
  TodayMarker
} from "react-calendar-timeline/lib";
import Modal from 'react-bootstrap/Modal';


function MainTimeline() {

    const url = 'http://localhost:8000';
    //const [personas, setPersonas] = useState([]);
    //const [equipos, setEquipos] = useState([]);
    const [items, setItems] = useState([]);
    const [grupos, setGrupos] = useState([]);

    // Consultar a la API

    //setGrupos(groups);
    useEffect(() => {
      getData();
    }, []);

    async function showItem(item, event, time) {

      console.log(item);
      console.log(event);
      console.log(time);

      if (item >= 10000) {
        // Es un equipo
        const id = item - 10000;
        //const res = await axios.get(`${url}/masignation/${id}`);

      } else {
        // Es una persona
        const id = item;
        const res = await axios.get(`${url}/pasignation/${id}`);
        console.log(res.data);
        const project_id = res.data.projectId;
        const people_id = res.data.PeopleId;
        // Mostrar modal

      }

    }


    async function getData () {
      const personas = await axios.get(`${url}/people`);
      const equipos = await axios.get(`${url}/equipment`);

      // Setear la informacion
      const asigned_persons = personas.data.map(persona => {
        return {
          id: persona.id,
          title: persona.name + ' ' + persona.lastname,

        }
      });
      const asigned_equipment = equipos.data.map(equipo => {
        return {
          id: equipo.id + 100,
          title: equipo.brand + ' ' + equipo.model
        }
      });

      const projects = await axios.get(`${url}/projects`);
      const pasignations = await axios.get(`${url}/pasignation`);
      const masignations = await axios.get(`${url}/masignation`);

      // Setear la informacion
      const asigned_pasignation = pasignations.data.map(pasignation => {
        return {
          id: pasignation.id,
          group: pasignation.PeopleId,
          title: projects.data[pasignation.projectId-1].name, // OJO CON ESTO
          start_time: moment(pasignation.init_date),
          end_time: moment(pasignation.finish_date),
          itemProps: {
            style: {
              background: '#30728C'
            }
          }
        }
      });

      const asigned_masignation = masignations.data.map(masignation => {
        return {
          id: masignation.id + 10000,
          group: masignation.EquipmentId + 100,
          title: projects.data[masignation.projectId-1].name, // OJO CON ESTO
          start_time: moment(masignation.init_date),
          end_time: moment(masignation.finish_date),
          itemProps: {
            style: {
              background: '#30728C'
            }

          }}
      });


      // Concatenar los arrays
      const groups = asigned_persons.concat(asigned_equipment);
      const items_aux = asigned_pasignation.concat(asigned_masignation);

      setItems(items_aux);
      setGrupos(groups);

    }

    const defaultTimeStart = moment()
      .startOf("day")
      .valueOf();
    const defaultTimeEnd = moment()
      .startOf("day")
      .add(14, "day")
      .valueOf();

    return (
      <div> 

      <Timeline
        groups={grupos}
        items={items}
        sidebarContent={<div>Above The Left</div>}
        itemsSorted
        itemTouchSendsClick={false}
        stackItems
        itemHeightRatio={0.9}
        showCursorLine
        canMove={false}
        canResize={false}
        buffer={100}
        defaultTimeStart={defaultTimeStart}
        defaultTimeEnd={defaultTimeEnd}
        onItemClick={(item, e, time) => showItem(item, e, time)}

        minZoom={60 * 60 * 1000 * 24 * 7}
      >
        <TimelineHeaders className="sticky">
        <TodayMarker />
        <DateHeader unit="primaryHeader" />
        <DateHeader />
        </TimelineHeaders>
      </Timeline>

      <div>
      <Modal show={showP} onHide={handleCloseP} backdrop="static">
        <Modal.Header closeButton>
          <Modal.Title>Asignar persona</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
              <Form.Label>Persona</Form.Label>
              <Form.Select aria-label="Default select example" onChange={(e) => setPersona(e.target.value)}>
                <option>Seleccionar persona</option>
                {personas.map((per) => (
                  <option value={per.id}>{per.name + ' ' + per.lastname}</option>
                ))}
              </Form.Select>
              <br />
              <Form.Label>Proyecto</Form.Label>
              <Form.Select aria-label="Default select example" onChange={(e) => setProyecto(e.target.value)}>
                <option>Seleccionar proyecto</option>
                {proyectos.map((pro) => (
                  <option value={pro.id}>{pro.name}</option>
                ))}
              </Form.Select>



            </Form.Group>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseP}>
            Cerrar
          </Button>
          <Button variant="primary" onClick={handleSubmitP}>
            Agregar asinación
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
    </div>


    );
  }

export default MainTimeline;
